import Api from "./Api";
import store from '../store'

export default {
    healthCheckUpload(file){
        console.log('uploading');

        store.dispatch("updateFileNameAction", file.name)

        let formData = new FormData()

        formData.append('file', file);

        return Api.post( '/file-progress',
        formData,
        {
          headers: {
              'Content-Type': 'multipart/form-data'
          },
          onUploadProgress: function( progressEvent ) {
            let progress =  parseInt( Math.round( ( progressEvent.loaded / progressEvent.total ) * 100 ) );
            this.$store.dispatch("updateProgressAction", progress)
            store.dispatch("updateProgressAction", progress)
          }.bind(this)
        }
      ).then(function(){
        console.log('SUCCESS!!');
      })
      .catch(function(){
        console.log('FAILURE!!');
      });
    }
}
